script: |
  super -f tsv -I q4596.sql | sort > q4596.out

vector: true

inputs:
  - name: q4596.sql
    data: |
      SELECT DISTINCT * FROM tab2 AS cor0 WHERE NOT col0 IN ( - col0, CAST ( + ( + + 90 ) AS INTEGER ), + + col2 / ( col0 ) / 44 + + - col0 - col2 * + 94 );
  - name: tab2

outputs:
  - name: q4596.out
    data: |
      46	51	23
      64	77	40
      75	67	58
